// 메뉴 전체 레이아웃
import React from 'react'
import PropTypes from 'prop-types'
import { Layout, Menu, Breadcrumb, Space } from 'antd';
import { UserOutlined, PieChartOutlined, DesktopOutlined} from '@ant-design/icons';
const { SubMenu } = Menu;
const { Header, Content, Sider } = Layout;

import Link from 'next/link';

const MenuHeader = () => {
    return (
      <Header className="header">
      <div className="logo" />
      
      <Menu style={{float: 'right'}} theme="dark" mode="horizontal">
        <Menu.Item key="1" icon={<UserOutlined />}><Link href ="/profile">profile</Link></Menu.Item>
        <Menu.Item key="2" icon={<UserOutlined />}><Link href ="/cart">cart</Link></Menu.Item>
      </Menu>
    </Header>
    )
}

export default MenuHeader;
